  bool valid_d(int x, int y) {
    if (x < 0 || x >= Msize || y < 0 || y >= Msize) {
      return false;
    }
    if (maze[x][y].visit) {
      return false;
    }
    return true;
  }

  bool valid_n(int x, int y) {
    int dx, dy;
    for (int i = 0; i < 4; i++) {
      if (i == 0) {
        dx = 0;
        dy = -1;
      }
      else if (i == 1) {
        dx = -1;
        dy = 0;
      }
      else if (i == 2) {
        dx = 0;
        dy = 1;
      }
      else {
        dx = 1;
        dy = 0;
      }

      if (valid_d(x + dx, y + dy)) {
        return true;
      }
    }
    return false;
  }

  void DFS_maze() {
    int stack[Msize * Msize][2]; //store x y loc in map
    int stackS = 0;
    int x = 0;
    int y = 0;

    stack[stackS][0] = x;
    stack[stackS][1] = y; 
    maze[x][y].visit = true;
    stackS++;
    
    while (stackS > 0) {
      stackS--;
      x = stack[stackS][0];
      y = stack[stackS][1];

      int d[4] = {0, 1, 2, 3}; // up, left, down, right
      int dr, temp;
      for (int i = 0; i < 4; i++) { // randomize directions
        dr = rand() % 4;
        temp = d[i];
        d[i] = d[dr];
        d[dr] = temp;
      }

      int dx, dy;
      for (int i = 0; i < 4; i++) {
        if (d[i] == 0) {
          dx = 0;
          dy = -1;
        }
        else if (d[i] == 1) {
          dx = -1;
          dy = 0;
        }
        else if (d[i] == 2) {
          dx = 0;
          dy = 1;
        }
        else {
          dx = 1;
          dy = 0;
        }

        if (valid_d(x + dx, y + dy)) {
          maze[x + dx][y + dy].visit = true;
          if (d[i] == 0) {
            maze[x][y].wall[0] = false;
            maze[x + dx][y + dy].wall[2] = false;
          }
          else if (d[i] == 1) {
            maze[x][y].wall[1] = false;
            maze[x + dx][y + dy].wall[3] = false;
          }
          else if (d[i] == 2) {
            maze[x][y].wall[2] = false;
            maze[x + dx][y + dy].wall[0] = false;
          }
          else {
            maze[x][y].wall[3] = false;
            maze[x + dx][y + dy].wall[1] = false;
          }
          
          if (valid_n(x, y)) {
            stack[stackS][0] = x;
            stack[stackS][1] = y;
            stackS++;
          }
          stack[stackS][0] = x + dx;
          stack[stackS][1] = y + dy;
          stackS++;
          break;
        }
      }
    }
  }   

  void make_maze() {
    for (int i = 0; i < Msize; i++) {
      for (int j = 0; j < Msize; j++) {
        maze[i][j].visit = false;
        for (int k = 0; k < 4; k++) {
          maze[i][j].wall[k] = true;
        }
      }
    }

    for (int i = 0; i < Gsize; i++) {
      for (int j = 0; j < Gsize; j++) {
        GmapC[i][j] = 0;
      }
    }

    DFS_maze();
  }

  void draw_maze() {
    int x, y, ix, jy;
    make_maze();

    for (int i = 0; i < Msize; i++) {
      for (int j = 0; j < Msize; j++) {
        ix = (i * 2) + 1;
        jy = (j * 2) + 1;

        x = 40 + ix * Csize;
        y = jy * Csize;
        
        draw_box(x, y, Csize, 0x9F6F);
        GmapC[ix][jy] = 1;

        if (!maze[i][j].wall[0] && jy - 1 > 0 && jy - 1 < Gsize) {
          if (GmapC[ix][jy - 1] == 0) {
            draw_box(x, y - Csize, Csize, 0x9F6F);
            GmapC[ix][jy - 1] = 1;
          }
        }
        if (!maze[i][j].wall[1] && ix - 1 > 0 && ix - 1 < Gsize) {
          if (GmapC[ix - 1][jy] == 0) {
            draw_box(x - Csize, y, Csize, 0x9F6F);
            GmapC[ix - 1][jy] = 1;
          }
        }
        if (!maze[i][j].wall[2] && jy + 1 > 0 && jy + 1 < Gsize) {
          if (GmapC[ix][jy + 1] == 0) {
            draw_box(x, y + Csize, Csize, 0x9F6F);
            GmapC[ix][jy + 1] = 1;
          }
        }
        if (!maze[i][j].wall[3] && ix + 1 > 0 && ix + 1 < Gsize) {
          if (GmapC[ix + 1][jy] == 0) {
            draw_box(x + Csize, y, Csize, 0x9F6F);
            GmapC[ix + 1][jy] = 1;
          }
        }
      }
    }
    draw_box(40 + Csize, 0, Csize, 0x9F6F);
    draw_box(40 + Csize * (Gsize - 2), Csize * (Gsize - 1), Csize, 0xFFFF);
    GmapC[1][0] = 1;
    GmapC[13][14] = 3;
  }

