  void update_coords() {
    volatile short int *one_pixel_address;
    short int color;
    for (int x = 0; x < 320; x++) {
      for (int y = 0; y < 240; y++) {
        one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
        color = *(one_pixel_address);
        if (color != 0xF800) {
          mapC[x][y] = color;
        }
      }
    }
  }

