  static void handler(void) __attribute__((interrupt("machine")));

  // void handler(void);
  void set_itimer(void);
  void itimer_ISR(void);

  volatile int time_counter;

  // Interrupt handler
  void handler(void) {
    int mcause_value;
    __asm__ volatile("csrr %0, mcause" : "=r"(mcause_value));
    if (mcause_value == 0x80000010) {
      itimer_ISR();
    }
  }

  // Setup timer
  void set_itimer(void) {
    time_counter = (60 / (levelC+1));
    volatile int *TIMER = (int *)TIMER_BASE;
    int clock_rate = CLOCK_RATE;
    *(TIMER + 2) = (clock_rate & 0xFFFF);
    *(TIMER + 3) = (clock_rate >> 16) & 0xFFFF;

    // start interval timer, enable its interrupts
    *(TIMER + 1) = 7;

    return;
  }
 
  // Interval timer ISR
  void itimer_ISR(void) {
    // Reset timer interval
    volatile int *TIMER = (int *)TIMER_BASE;
    *TIMER = 0;
    printf("%d\n", time_counter);
    if (time_counter > 0) {
      time_counter--;
    }
    if (time_counter == 0) {
      lose_game();
    }
    return;
  }

  void lose_game() {
    endgame = true;
  }

  void timer_interrupts() {
    set_itimer(); 
    int mstatus_value, mtvec_value, mie_value;
    // Turn MIE bit on
    mstatus_value = 0b1000;
    __asm__ volatile("csrc mstatus, %0" ::"r"(mstatus_value));

    // Enter mtvec value (address)
    mtvec_value = (int)&handler;
    __asm__ volatile("csrw mtvec, %0" ::"r"(mtvec_value));

    // disable all interrupts that are currently enabled
    __asm__ volatile("csrr %0, mie" : "=r"(mie_value));
    __asm__ volatile("csrc mie, %0" ::"r"(mie_value));
    mie_value = 0x10000;

    // Turn MIE register on
    __asm__ volatile("csrs mie, %0" ::"r"(mie_value));

    // enable NIOS V interrupts
    __asm__ volatile("csrs mstatus, %0" ::"r"(mstatus_value));
  }

